import React from 'react'

function EventList() {
  return (
    <div>
        {select.length === 0 && <h1>Not content</h1>}
        {select.map((value) => {
          return(
            <div className="app-info" key={value.id}>
              <h1>{value.title}</h1>
              <button onClick={() => (handleDelete(value.id))}>delete</button>
            </div>
          )
        }) }
      </div> 
  )
}

export default EventList
